import { createStore } from 'vuex'

const store = createStore({
  state(){
    return{
      data:"eee",
      todoThings:[]
    }
  },
  getters: {
  },
  mutations: {
    sendTodo(state,params) {
      state.data = params
    }
  },
  actions: {
    increment({ commit } , data) {

      commit('sendTodo',data)

    }
  },
  modules: {
  }
})
export default store
